def parse(code):
    current = code[0]
    coded = []
    amount = 0
    for i in range(0,len(code)):
        if code[i] == current:
            amount += 1
        else:
            coded.append((current,amount))
            amount = 1
            if i < len(code):
                current = code[i]
    return coded


keypad = [[1,2,3],[4,5,6],[7,8,9]]

def need_adjust(n): return n<0 or n>2
    
def adjust(n):
    if   n < 0:  return 0
    elif n > 2:  return 2
    else:        return n

def travel(tup):
    direction, times = tup
    if   direction == 'U': return -times,0
    elif direction == 'R': return 0,times
    elif direction == 'L': return 0,-times
    else:                  return times,0

def key(code):
    pos = [1,1]
    nums = []
    for instructions in code:
        coded = parse(instructions)
        for i in coded:
            v,h = travel(i)
      #      print(v,h)
       #     print(pos)
            pos[0] += v
            pos[1] += h
        #    print(pos)
            pos[0] = adjust(pos[0])
            pos[1] = adjust(pos[1])
         #   print(pos)
        print('Number: {}'.format(keypad[pos[0]][pos[1]]))
        nums.append(keypad[pos[0]][pos[1]])
    return nums

